			<textarea id="editor"># KanTanMarkdown



## Overview
KantanMarkdown is a standalone markdown editor and viewer. It runs on single HTML file.



## Features


### Edit &amp; Preview
KantanMarkdown has not only editing mode but also viewing mode.
 You don't need convert markdown to HTML(or PDF) file.


### Attachment
KantanMarkdown can include any files. You can attach files to KantanMarkdown with the same feeling as e-mail.

For example, an image below is a picture file attached to this file.  
&lt;img src="attach:sample.png"&gt;



## How to use


### View
You have already used KantanMarkdown. Because this page is written by KantanMarkdown.


### Edit
Click "編集／閲覧(ESC)" button to change it to an editing mode.  

In editing mode, you can see markdown editor on left side. And right side is previewer.
When you change the markdown, it syncs to the previewer.  
&lt;img src="attach:edit.gif"&gt;


### Save
Click "保存(Ctrl+S)" button to save this file.The browser will start to download the copy of this file.

Next, open the file which you just downloaded. You will see a page which you edited.  
&lt;img src="attach:save.gif"&gt;


### Attachment
Drag and drop files on this page to attach them.

You can download a file when you click the "download" button.  
&lt;img src="attach:attach.gif"&gt;

If you want to make a downloading link, insert an HTML code below.

~~~html
&lt;a href="attach:sample.txt"&gt;download&lt;/a&gt;
~~~

&lt;a href="attach:sample.txt"&gt;download&lt;/a&gt;


### Display image
You can display the attached image file.

```html
&lt;img src="attach:sample.png"&gt;
```

&lt;img src="attach:sample.png"&gt;

### Editing image
You can edit the attached image file.
&lt;img src="attach:editImage.gif"&gt;


### Custom CSS
You can change the page layout by CSS.
&lt;img src="attach:css.gif"&gt;


## Internationalization
At the moment, I am developing only Japanese version. If there are any requests, I may develop a internationalization version.

If you are interested in KantanMarkdown, please reply to [@tatesuke on twitter](https://twitter.com/tatesuke) or [github](https://github.com/tatesuke/KanTanMarkdown).</textarea>

    line-height: 19px;
    padding: 6px 10px;
    border-radius: 0px;
    margin: 1em 0px 1em;
}
.alert {
    color: #b94a48;
    background-color: #f2dede;
    border: 1px solid #eed3d7;
    font-size: 13px;
    line-height: 19px;
    padding: 6px 10px;
